import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';

const Styles = makeStyles((theme: Theme) =>
  createStyles({
    carouselStyles: {
      height: theme.spacing(68),
      overflow: 'hidden',
    },
    images: {
      width: '100%',
      height: '100%',
    },
    paperImg: {
      minWidth: 275,
      minHeigth: 300,
    },
  })
);

export default Styles;
